    Build Configurations:
    - Debug:
        Build Settings:
          PRODUCT_NAME: "$(TARGET_NAME)"
          PUBLIC_HEADERS_FOLDER_PATH: "$(TARGET_NAME)"
          SDKROOT: iphoneos
